import { Banner,Introduction,Member,Journey,Ticket,Passenger,Departure,Checkout,Bank,Applepay,Credit } from '../components'
// import Banner from '../components/Banner'
// import Introduction from '../components/Introduction'
// import Member from '../components/Member'
// import Journey from '../components/Journey'
// import Ticket from '../components/Journey/Ticket'
// import Passenger from '../components/Journey/Passenger'
// import Departure from '../components/Journey/Departure'
// import Checkout from '../components/Checkout'
// import Bank from '../components/Checkout/Bank'
// import Applepay from '../components/Checkout/Applepay'
// import Credit from '../components/Checkout/Credit'
import {Navigate} from 'react-router-dom'

const routes=[
    {
        path:'/banner',
        element:<Banner/>
    },
    {
        path:'/Introduction',
        element:<Introduction/>
    },
    {
        path:'/member',
        element:<Member member={'member'}/>
    },
    {
        path:'/journey',
        element:<Journey/>,
        children:[
            {
                path:'ticket',       // 註冊子級路由不須寫"/"
                element:<Ticket/>
            },
            {
                path:'departure',
                element:<Departure/>
            },
            {
                path:'passenger',
                element:<Passenger/>
            },
            {   // 子組件的地方也做重定向
                path:'/journey',
                element:<Navigate to='ticket'/>
            }
        ]
    },
    {
        path:'/checkout',
        element:<Checkout/>,
        children:[
            {
                path:'bank',
                element:<Bank/>
            },
            {
                path:'applepay',
                element:<Applepay/>
            },
            {
                path:'credit',
                element:<Credit/>
            }
        ]
    },
    {
        path:'/',
        element:<Navigate to='/banner'/>
    }
]

export default routes;
